import {Feature} from './Feature';
import {Util} from './Util';

/**
 * @class FeatureVector
 * @aliasclass Feature.Vector
 * @deprecatedclass SuperMap.Feature.Vector
 * @category BaseTypes Geometry
 * @classdesc  Geometry 
 * attributes  style 
 *  {@link FeatureVector.style} 
 * @extends {Feature}
 * @param {Geometry} geometry - 
 * @param {Object} [attributes] -  attributes 
 * @param {Object} [style] - 
 * @example
 * var geometry = new GeometryPoint(-115,10);
 *  var style = {
     *      strokeColor:"#339933",
     *      strokeOpacity:1,
     *      strokeWidth:3,
     *      pointRadius:6
     *  }
 *  var pointFeature = new FeatureVector(geometry,null,style);
 *  vectorLayer.addFeatures(pointFeature);
 * @usage
 */
// TRASH THIS
export const State = {
  /** states */
  UNKNOWN: 'Unknown',
  INSERT: 'Insert',
  UPDATE: 'Update',
  DELETE: 'Delete'
};
export class Vector extends Feature {


    constructor(geometry, attributes, style) {
        super(null, null, attributes);
        /**
         * @member {string} FeatureVector.prototype.fid
         * @description fid
         */
        this.fid = null;

        /**
         * @member {Geometry} FeatureVector.prototype.geometry
         * @description 
         */
        this.geometry = geometry ? geometry : null;

        /**
         * @member {Object} FeatureVector.prototype.attributes
         * @description 
         */
        this.attributes = {};

        if (attributes) {
            this.attributes = Util.extend(this.attributes, attributes);
        }

        /**
         * @member {Bounds} FeatureVector.prototype.bounds
         * @description 
         */
        this.bounds = null;

        /**
         * @member {string} FeatureVector.prototype.state
         * @description state
         */
        this.state = null;

        /**
         * @member {Object} FeatureVector.prototype.style
         * @description  feature  style8C null
         */
        this.style = style ? style : null;

        /**
         * @member {string} FeatureVector.prototype.url
         * @description  {@link HTTP} 
         */
        this.url = null;

        this.lonlat = null;

        this.CLASS_NAME = "SuperMap.Feature.Vector";

        Vector.style = {
            'default': {
                fillColor: "#ee9900",
                fillOpacity: 0.4,
                hoverFillColor: "white",
                hoverFillOpacity: 0.8,
                strokeColor: "#ee9900",
                strokeOpacity: 1,
                strokeWidth: 1,
                strokeLinecap: "round",
                strokeDashstyle: "solid",
                hoverStrokeColor: "red",
                hoverStrokeOpacity: 1,
                hoverStrokeWidth: 0.2,
                pointRadius: 6,
                hoverPointRadius: 1,
                hoverPointUnit: "%",
                pointerEvents: "visiblePainted",
                cursor: "inherit",
                fontColor: "#000000",
                labelAlign: "cm",
                labelOutlineColor: "white",
                labelOutlineWidth: 3
            },
            'select': {
                fillColor: "blue",
                fillOpacity: 0.4,
                hoverFillColor: "white",
                hoverFillOpacity: 0.8,
                strokeColor: "blue",
                strokeOpacity: 1,
                strokeWidth: 2,
                strokeLinecap: "round",
                strokeDashstyle: "solid",
                hoverStrokeColor: "red",
                hoverStrokeOpacity: 1,
                hoverStrokeWidth: 0.2,
                pointRadius: 6,
                hoverPointRadius: 1,
                hoverPointUnit: "%",
                pointerEvents: "visiblePainted",
                cursor: "pointer",
                fontColor: "#000000",
                labelAlign: "cm",
                labelOutlineColor: "white",
                labelOutlineWidth: 3

            },
            'temporary': {
                fillColor: "#66cccc",
                fillOpacity: 0.2,
                hoverFillColor: "white",
                hoverFillOpacity: 0.8,
                strokeColor: "#66cccc",
                strokeOpacity: 1,
                strokeLinecap: "round",
                strokeWidth: 2,
                strokeDashstyle: "solid",
                hoverStrokeColor: "red",
                hoverStrokeOpacity: 1,
                hoverStrokeWidth: 0.2,
                pointRadius: 6,
                hoverPointRadius: 1,
                hoverPointUnit: "%",
                pointerEvents: "visiblePainted",
                //cursor:"inherit",
                cursor: "default",
                fontColor: "#000000",
                labelAlign: "cm",
                labelOutlineColor: "white",
                labelOutlineWidth: 3

            },
            'delete': {
                display: "none"
            }
        };
    }

    /**
     * @function FeatureVector.prototype.destroy
     * @description 
     */
    destroy() {
        if (this.layer) {
            this.layer.removeFeatures(this);
            this.layer = null;
        }

        this.geometry = null;
        super.destroy();
    }

    /**
     * @function FeatureVector.prototype.clone
     * @description 
     * @returns {FeatureVector} 
     */
    clone() {
        return new Vector(
            this.geometry ? this.geometry.clone() : null,
            this.attributes,
            this.style);
    }

    /**
     * @function FeatureVector.prototype.toState
     * @description 
     * @param {string} state - 
     */
    toState(state) {
        if (state === State.UPDATE) {
            switch (this.state) {
                case State.UNKNOWN:
                case State.DELETE:
                    this.state = state;
                    break;
                case State.UPDATE:
                case State.INSERT:
                    break;
            }
        } else if (state === State.INSERT) {
            switch (this.state) {
                case State.UNKNOWN:
                    break;
                default:
                    this.state = state;
                    break;
            }
        } else if (state === State.DELETE) {
            switch (this.state) {
                case State.INSERT:
                    // the feature should be destroyed
                    break;
                case State.DELETE:
                    break;
                case State.UNKNOWN:
                case State.UPDATE:
                    this.state = state;
                    break;
            }
        } else if (state === State.UNKNOWN) {
            this.state = state;
        }
    }
}
/**
 *
 * @typedef {Object} FeatureVector.style
 * @description Feature 
 *  SVG 
 * - fill properties {@link http://www.w3.org/TR/SVG/painting.html#FillProperties}
 * - stroke properties {@link http://www.w3.org/TR/SVG/painting.html#StrokeProperties}
 * @property {boolean} [fill] -  false
 * @property {string} [fillColor='#ee9900'] - 
 * @property {number} [fillOpacity=0.4] - 
 * @property {boolean} [stroke] -  false
 * @property {string} [strokeColor='#ee9900'] - 
 * @property {number} [strokeOpacity=0.4] - (0-1)
 * @property {number} [strokeWidth=1] - 
 * @property {string} [strokeLinecap='round'] - strokeLinecap  buttroundsquare
 * @property {string} [strokeDashstyle='solid'] -  dotdashdashdotlongdashlongdashdotsolid 
 * @property {boolean} [graphic] -  false
 * @property {number} [pointRadius=6] - 
 * @property {string} [pointerEvents='visiblePainted'] - pointerEvents
 * @property {string} [cursor] - cursor
 * @property {boolean} [allowRotate='false'] - 
 * @property {string} [externalGraphic] - 
 * @property {number} [graphicWidth] - 
 * @property {number} [graphicHeight] - 
 * @property {number} [graphicOpacity] - (0-1)
 * @property {number} [graphicXOffset] - x
 * @property {number} [graphicYOffset] - y Pixel
 * @property {number} [rotation] - 
 * @property {number} [graphicZIndex] - 
 * @property {string} [graphicName='circle'] - "circle" , "square", "star", "x", "cross", "triangle"
 * @property {string} [graphicTitle] - 
 * @property {string} [backgroundGraphic] - 
 * @property {number} [backgroundGraphicZIndex] - 
 * @property {number} [backgroundXOffset] -  x 
 * @property {number} [backgroundYOffset] -  y 
 * @property {number} [backgroundHeight] -  graphicHeight
 * @property {number} [backgroundWidth] -  graphicWidth
 * @property {boolean} [isUnicode=false] -  label  truelabel  unicode 
 *  "a"  unicode  61 label  "&#x61;", "&#"  unicode 
 * "x"  16 , "a" false label 
 * label  "&#x61;" "&#x61;"
 * @property {string} [label] - 
 * @property {string} [labelAlign='cm'] - "lt", "cm", "rb"
 * "l"=left, "c"=center, "r"=right
 * "t"=top, "m"=middle, "b"=bottom
 * @property {number} [labelXOffset] -  x 
 * @property {number} [labelYOffset] -  y 
 * @property {boolean} [labelSelect=false] -  true SelectFeature  similar 
 * @property {string} [fontColor='#000000'] - 
 * @property {number} [fontOpacity] -  (0-1)
 * @property {string} [fontFamily] - 
 * @property {string} [fontSize] - 
 * @property {string} [fontStyle] - 
 * @property {string} [fontWeight] - 
 * @property {string} [display] -  display  none
 * @example
 *  // label
 *  function addGeoTest(){
 *  var geometry = new GeometryPoint(105, 35);
 *  var pointFeature = new FeatureVector(geometry);
 *  var styleTest = {
 *        label:"supermap",
 *        fontColor:"#0000ff",
 *        fontOpacity:"0.5",
 *        fontFamily:"",
 *        fontSize:"8em",
 *        fontWeight:"bold",
 *        fontStyle:"italic",
 *        labelSelect:"true",
 *     }
 *           pointFeature.style = styleTest;
 *          vectorLayer.addFeatures([pointFeature]);
 * }
     */
